import React from 'react';
import { BrowserRouter as Router, Route ,Routes} from 'react-router-dom';
import Dashboard from './components/DashBoard';

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
        <Route path="/" component={Dashboard} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
